maxv = 1000005
isprime = [True for _ in range(maxv+1)]
isprime[1] = False
primes = []
for i in range(2, maxv+1):
    if isprime[i]:
        primes.append(i)
        v = i + i
        while v <= maxv:
            isprime[v] = False
            v += i
            

class Solution:
    def splitArray(self, nums: List[int]) -> int:
        
        def gcd(x, y):
            while y:
                x, y = y, x % y
        
            return x
            
        def defact(val):
            if isprime[val]:
                return [val]
            
            fs = []
            for v in primes:
                if v > val or isprime[val]:
                    break
                if val % v == 0:
                    fs.append(v)
                    while val % v == 0:
                        val //= v
            if val > 1:
                fs.append(val)
                
            return fs
        
        cofact = collections.defaultdict(list)
        n = len(nums)
        dp = [n for _ in range(n)]
        dp[0] = 1
        for i in range(1, n):
            v = nums[i]
            if gcd(nums[0], v) > 1:
                dp[i] = 1
                continue

            dp[i] = dp[i-1] + 1
            for u in defact(v):
                for j in cofact[u]:
                    dp[i] = min(dp[i], dp[j-1] + 1)
                cofact[u].append(i)

        return dp[-1]
    
